import { connect } from 'react-redux'
import {setCoinsThunkCreator} from '../../redux/coin-reducer'

const CoinElement = (props) => {
    //debugger
    const [coins, setCoins] = useState([])

    useEffect(() => {
        setCoins(setCoinsThunkCreator())
    }, [])

    

    if(typeof(props))
    return (
      <div>
        <div>
          <img src={props.img} />
        </div>
        <div>
          <div>{props.name}</div>
        </div>
        <div>
          <div>${(+props.price)}</div>
        </div>
        <div>
          <div>{+props.price_change_prc}</div>
        </div>
        <div>
        </div>
      </div>
    );
  };

  const CoinContainer1 = connect(null, {setCoinsThunkCreator})(CoinElement)

